//import React from 'react';
import React, { useState, useEffect } from 'react';
import './SearchResultsPage.css';

async function GetProducts() {
    // fetch data from our API
    const res = await fetch('http://localhost:8080/v1/products')   
    console.log(res);
    // Recommendation: handle errors
    if (!res.ok) {
        // This will activate the closest `error.js` Error Boundary
        throw new Error('Failed to fetch data')
    }
    return res.json()
}

export function Product() {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        async function fetchData() {
            try {
                const result = await GetProducts();
                setProducts(result);
            } catch (error) {
                console.error("Failed to fetch products:", error);
            }
        }
        fetchData();
    }, []);

    return (
        <main> 
            <h1>Products List</h1> 
            <div>
                <ul> 
                    {products.map(product => (
                        <li key={product.productID}>{product.productName} ({product.size})</li>
                    ))}
                </ul> 
            </div>
        </main>
    );
}


const totalResults = 100;
const displayedResults = 10;

const SearchResultsPage = () => {
    const hardcodedProduct = {
        id: "test-laptop-id",
        photo: "/Computer.jpg",
        name: "MacBook Pro Laptop",
        unit: "kg",
        price: 3500
    };

    const [products, setProducts] = useState([hardcodedProduct]);
    const [searchTerm, setSearchTerm] = useState("Milk");

    useEffect(() => {
        searchProducts(searchTerm);
    }, [searchTerm]);

    function searchProducts(name) {
        const apiUrl = `/api/products/search?name=` + name;

        fetch(apiUrl)
        .then(response => response.json())
        .then(data => {
            console.log("Fetched data:", data);
            setProducts([hardcodedProduct, ...data.products]);
        })
        .catch(error => {
            console.error("Error fetching search results:", error);
        });
    }

    return (
        <div className="tableWrapper">
            <div className="tableContainer">
                <div className="tableHeaderInfo">
                    Showing results for: <strong>{searchTerm}</strong>
                </div>
                <div className="tableHeaderInfo">
                    Total results: {totalResults}
                </div>
                <div className="tableHeaderInfo">
                    Displaying: {displayedResults}
                </div>
            </div>
            <div className="buttonsContainer">
                <button>
                    <img src="icons/SortIcon.png" alt="Sort" width="20" />
                    Sort by
                </button>
                <button>
                    <img src="icons/FilterIcon.png" alt="Filter" width="20" />
                    Filters
                </button>
            </div>
            <table>
                <thead>
                    <tr>
                        <th>Product Photo</th>
                        <th>Product Name</th>
                        <th>Unit</th>
                        <th>Price ($)</th>
                        <th>Add To Cart</th>
                    </tr>
                </thead>
                <tbody>
                {products.map(product => (
                    <tr key={product.productID}>   {/* adjusted to product.productID */}
                        <td><img src={product.photo} alt={product.productName} width="200" /></td> {/* adjusted alt */}
                        <td>{product.productName}</td>
                        <td>{product.size}</td>
                        <td>${product.unit}</td> {/* adjusted to product.price and added dollar sign */}
                        <td><button>Add To Cart</button></td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
}

export default SearchResultsPage;
